(()=>{const a=Array.from(document.querySelectorAll("csres[data-url]"));(async()=>{for(const n of a){const u=n.getAttribute("data-url");const k=(n.getAttribute("data-type")||(/\.(css)(\?|#|$)/i.test(u)?"css":"js")).toLowerCase();const t=await fetch(u).then(r=>r.text());if(k==="css"){const e=document.createElement("style");e.textContent=t;n.replaceWith(e)}else{const e=document.createElement("script");e.textContent=t;n.replaceWith(e)}}})()})();